console.image=function(){for(var e=arguments.length,n=new Array(e),o=0;o<e;o++)n[o]=arguments[o];const t=["%c ".repeat(n.length)];for(const e of n){const o=new Image;o.src=e,o.onload=(()=>{t.push('background-image:url("'+e+'");padding:'+o.height/2+"px "+o.width/2+"px;line-height:"+o.height+"px;font-size:0px;"),t.length===n.length+1&&console.log(...t)}),0}};